// Type of modal for displaying.
export const WITHOUT_MODAL = 0;
export const DISPLAY_SIGN_IN_MODAL = 1;
export const DISPLAY_SIGN_UP_MODAL = 2;
export const DISPLAY_CREATING_CAR_MODAL = 3;
export const DISPLAY_EDITING_CAR_MODAL = 4;
export const DISPLAY_REMOVING_CAR_MODAL = 5;

// Code of response from server.
export const OK_RESPONSE_CODE = 0;
export const UNKNOWN_ERROR_RESPONSE_CODE = 1;
export const AUTHENTICATION_ERROR_RESPONSE_CODE = 2;
export const USERNAME_VALID_ERROR_RESPONSE_CODE = 3;
export const INVALID_ID_ERROR_RESPONSE_CODE = 4;
